(()=>{return(t,s)=>{const n={less:-1,equal:0,greater:1,incomparable:NaN};class e{constructor(t){this.parts=t.split(".").map(t=>parseInt(t));this.versionString=t}compareTo(t){for(let s=0;s<this.parts.length;++s){if(t.parts.length===s){return n.greater}if(this.parts[s]===t.parts[s]){continue}if(this.parts[s]>t.parts[s]){return n.greater}return n.less}if(this.parts.length!==t.parts.length){return n.less}return n.equal}greaterThan(t){return this.compareTo(t)===n.greater}lessThan(t){return this.compareTo(t)===n.less}equals(t){return this.compareTo(t)===n.equal}}const i=new e(s.data.latestVersion.text);const a=new e(t.currentVersion);if(i.greaterThan(a)){if(a.lessThan(new e("1.4.2"))){SpinQuery.any(()=>$(".gui-settings"),s=>{s.addClass("gui-settings-notification");const n=$(".gui-settings-footer");n.after(`\n                        <div class="gui-settings-footer">\n                            <span class="gui-settings-label">新版本${i.versionString}已发布.</span>\n                            <a>\n                                <button\n                                    class="gui-settings-button"\n                                    id="new-version-update">\n                                    更新\n                                </button>\n                            </a>\n                        </div>`);$("#new-version-update").parent().attr("href",t.latestVersionLink)});const s=`新版本${i.versionString}已发布.  <a class="link" href="${t.latestVersionLink}">更新</a>`;Toast.show(s,"检查更新",1e4)}else{return{settingsWidget:{after:()=>$(".gui-settings-content"),content:`<div class="gui-settings-footer${t.blurSettingsPanel?" blur":""}">\n                                    <span class="gui-settings-label">新版本${i.versionString}已发布.</span>\n                                    <a href="${t.latestVersionLink}">\n                                        <button\n                                            class="gui-settings-button"\n                                            id="new-version-update">\n                                            更新\n                                        </button>\n                                    </a>\n                                    <a target="blank"  href="https://github.com/the1812/Bilibili-Evolved/releases">\n                                        <button\n                                            class="gui-settings-button">\n                                            详细信息\n                                        </button>\n                                    </a>\n                                </div>`,success:()=>{SpinQuery.any(()=>$(".gui-settings"),t=>{t.addClass("gui-settings-notification")});const s=`新版本${i.versionString}已发布.  <a class="link" href="${t.latestVersionLink}">更新</a><a class="link" target="_blank"   href="https://github.com/the1812/Bilibili-Evolved/releases">详细信息</a>`;Toast.show(s,"检查更新")}}}}}}})();